var title_f10_31_10748="Chang staging medulloblastoma";
var content_f10_31_10748=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ONC%2F73044&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ONC%2F73044&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Modified Chang system for staging of medulloblastoma",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_left\" colspan=\"2\" rowspan=\"1\">",
"        Extent",
"of tumor",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        T1",
"       </td>",
"       <td>",
"        Tumor less than 3 cm in diameter",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        T2",
"       </td>",
"       <td>",
"        Tumor greater than 3",
"cm in diameter",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        T3a",
"       </td>",
"       <td>",
"        Tumor greater than 3 cm in diameter with extension into",
"the aqueduct of Sylvius and/or the foramen of Luschka",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        T3b",
"       </td>",
"       <td>",
"        Tumor greater than 3 cm in diameter with unequivocal",
"extension into the brain stem",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        T4",
"       </td>",
"       <td>",
"        Tumor greater than 3 cm in diameter with extension up",
"past the aqueduct of Sylvius and/or down past the foramen magnum",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"2\" rowspan=\"1\">",
"        No consideration",
"is given to the number of structures invaded or the presence of",
"hydrocephalus.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"2\" rowspan=\"1\">",
"        T3b can be",
"defined by intraoperative demonstration of tumor extension into the",
"brain stem in the absence of radiographic evidence.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_left\" colspan=\"2\" rowspan=\"1\">",
"        Degree",
"of metastasis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        M0",
"       </td>",
"       <td>",
"        No evidence of gross subarachnoid or hematogenous",
"metastasis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        M1",
"       </td>",
"       <td>",
"        Microscopic tumor cells found in the cerebrospinal fluid",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        M2",
"       </td>",
"       <td>",
"        Gross nodular seeding demonstrated in the",
"cerebellar/cerebral subarachnoid space or in the third or lateral",
"ventricles",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        M3",
"       </td>",
"       <td>",
"        Gross nodular seeding in the spinal subarachnoid space",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        M4",
"       </td>",
"       <td>",
"        Metastasis outside the cerebrospinal axis",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     From Chang, CH, Housepain, EM, Herbert, C, Radiology 1969; 93:1351, and Cohen, ME, Duffner, PK (Eds). Brain Tumors in Children, 2d ed, McGraw-Hill, New York, 1994, p. 187.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
